import React from 'react'
import './Humidity.css'


const Humidity = ({weather, dummyData}) => {
    console.log(weather, " humidity wea")
    console.log(dummyData.main.humidity, " humidity dummy")
    return (
        <div className='humidity'>
            <p>Humidity</p>
            { weather ? (
                <p className='vis-num'>weather</p>
            ) : (
                <p className='vis-num'> {dummyData ? console.log(dummyData) : 'N/A'}</p>
            )}
        </div>
    )
}

export default Humidity
